INSERT INTO `faq` VALUES (21,'Comment fonctionne Health-Eir ? ','Le dispositif Health-Eir est un boitier qui mesure les données environnementales et physiologiques d\'un patient hospitalisé à domicile. Les données sont collectées par des capteurs intégrés dans le boitier et envoyées en temps réel à une plateforme en ligne sécurisée, où le médecin traitant et la famille peuvent les consulter. '),(22,'Comment puis-je accéder aux données de santé de mon proche hospitalisé à domicile ? ','Vous pouvez accéder aux données de santé de votre proche à tout moment en vous connectant à notre plateforme en ligne sécurisée. Vous aurez besoin de vos identifiants de connexion pour accéder à votre compte.\r\n\r\nUne fois que vous vous êtes connectés, vous pouvez vous rendre dans l\'onglet \'Health-View\' à partir du menu déroulant de votre session utilisateur. Cette page affichera alors toutes les données nécessaires pour évaluer la qualité de l\'hospitalisation à domicile de votre proche. '),(23,'Comment créer un profil utilisateur sur le site web ? ','Pour créer un profil utilisateur sur le site web, il suffit de cliquer sur le bouton \"Inscription\" et de remplir le formulaire d\'inscription en fournissant vos informations personnelles. Vous pourrez ensuite vous connecter avec l\'email et le mot de passe indiqués.'),(24,'Comment modifier les informations de mon profil utilisateur ? ','Pour modifier les informations de votre profil utilisateur, il suffit de vous connecter à votre compte et de cliquer sur le bouton \"Modifier le profil\". Vous pourrez ensuite mettre à jour les informations de votre profil, comme votre adresse e-mail, votre mot de passe ou votre photo de profil.'),(25,'Comment puis-je paramétrer les seuils d\'alerte des capteurs ? ','Le médecin traitant est le seul à pouvoir paramétrer les seuils des capteurs. Si vous souhaitez modifier les seuils, vous pouvez contacter le médecin traitant et lui demander de les ajuster en fonction de la situation de santé de votre proche.'),(26,'Comment paramétrer les alertes pour recevoir des notifications en cas de dépassement de seuils ? ','Pour recevoir des alertes en cas de dépassement de seuils, par exemple si le patient a une fréquence cardiaque importante ou que la température de la chambre d\'hospitalisation est trop élevée, vous pouvez activer les notifications dans les paramètres de votre profil, onglet \'Notifications\'. '),(27,'Est-ce que Health-Eir est sécurisé ? ','Oui, Health-Eir est conçu pour être hautement sécurisé. Les données de santé de votre proche sont stockées sur une plateforme en ligne sécurisée et ne sont accessibles qu\'aux personnes autorisées.\r\n\r\nNous utilisons également des protocoles de sécurité avancés pour protéger les données de santé contre les accès non autorisés. '),(28,'Est-ce que je peux donner accès à d\'autres membres de ma famille pour consulter les données de santé de mon proche hospitalisé à domicile ? ','Oui, vous pouvez donner accès à d\'autres membres de votre famille pour consulter les données de santé de votre proche hospitalisé à domicile.\r\n\r\nPour ce faire, il suffit de vous connecter à votre compte et de copier la clé \'Health-Key\' correspondant à votre dispositif Health-Eir qu\'il aura préalablement fallu enregistrer sur votre espace.\r\n\r\nVous pourrez ensuite transmettre à lien de connexion à un autre membre de la famille pour que celui-ci puisse pouvoir consulter les données de santé du patient. ');
/*!40000 ALTER TABLE `faq` ENABLE KEYS */;
UNLOCK TABLES;

